import React from 'react';
import { Location, LocationList } from './Components/LocationList';

interface LeftPanelProps {
    locations: Location[];
}

export const LeftPanel = ({locations}: LeftPanelProps) => {
    return (
        <>
            <h2>Locations</h2>
            <LocationList locations={locations} />
        </>
    );
};
